  \"2013-03-15T21:07:39.862153\",\n\t\"name\": \"archydro-global-datasets-for-idaho-streamstats\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of a personal geodatabase
  containing several vector datasets. This database contains the information needed
  to link the HUCs together so a watershed may be delineated that spans more than
  one 8-digit HUC. These datasets may be used with the ArcHydro Tools, developed by
  ESRI in partnership with the U.S. Geological Survey, StreamStats Development Team.
  The datasets, together with the ArcHydro Tools and the ArcHydro 8-digit HUC datasets
  for an area of interest, allow users to delineate watersheds and compute several
  watershed characteristics.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
